import React from 'react';
import animals from '../photos/animals.jpg';
import { BrowserRouter, Link, Route, Routes} from "react-router-dom";

const styles = {
  backgroundImage: `url(${animals})`,
  height: '100vh',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
};

function Homepage() {
    return (
      <div style={styles} className="container">
        <h1 className='display-1 position-absolute top-0 start-50 translate-middle-x'>AniHelp</h1>
        <button className='bd-highlight" w-20'>Login</button>
        <button className='position-absolute top-0 start-20 w-20'>Sign up</button>
      </div>
    );
  }
  
  export default Homepage;
